webpackJsonp([0xa29c2f64bac7],{452:function(e,t){e.exports={data:{markdownRemark:{html:'<blockquote>\n<p>Accelerate your learning by sharing what you learn with others while you are\nlearning it.</p>\n</blockquote>\n<p>Experts aren\'t people who know absolutely everything in their field of expertise.\nTake GPs for example, they provide <strong>educated guesses</strong> based on textbook\nlearnings and through their real world experiences. Scientists are constantly\ndisproving previously proved theories. We are people and we get things wrong\nsometimes.</p>\n<p>Regardless, if you take the time to explain what you learn to someone, you learn more\nabout that particular topic. You start to make sense of the jumbled snippets of\ninformation in your mind by painting a bigger picture.</p>\n<p>The more you explain and share things, the more you learn and the more others\ncan validate, correct or offer alternative perspectives or solutions to what\nyou share.</p>\n<blockquote>\n<p>The one exclusive sign of thorough knowledge is the power of teaching.\n~ Aristotle</p>\n</blockquote>\n<p>I gave an Ignite talk about this topic called\n"<a href="/blog/branding-your-identity/">Branding your Identity</a>" so this idea isn\'t new\nto me. But then <a href="https://twitter.com/riggaroo">Rebecca</a> was kind enough to share\nan exceptional talk by\n<a href="https://www.blogger.com/profile/01970007638489793840">Chiu-Ki Chan</a>.</p>\n<p>Chiu-Ki Chan spoke at the\n<a href="https://www.youtube.com/playlist?list=PLWz5rJ2EKKc_Tt7q77qwyKRgytF1RzRx8">Android Summit 2015</a>\nconference called "How to be an Android Expert".</p>\n<p>Her 30 minute talk can benefit any software developer as she gives you great\ninsights about what it actually means to be an expert in the software\ndevelopment community.</p>\n<p>She also provides useful tips and techniques about how to easily write\ntechnical blog posts and give talks at events.</p>\n<p>The biggest take away from this talk is that "<strong>by sharing</strong> [what you know] <strong>you\ngain expertise and then you get to be a part of a much larger\ncommunity than you so that when you need to do something there are people\nbehind you.</strong>"</p>\n<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 62.32142857142857%; position: relative; height: 0; overflow: hidden;"\n          >\n            <div class="video-wrapper">\n    <iframe class="youtube" src="https://www.youtube.com/embed/PeKKzeAte30" frameborder="0" allowfullscreen style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          ">\n    </iframe>\n</div>\n          </div>\n          </div>\n<p>On her blog, she states that her career has benefited tremendously from\nwriting blog posts, speaking at conferences and sharing her code as open\nsource.</p>\n<p>If you are interested in giving talks, you can check out her blog post about\n<a href="http://blog.sqisland.com/2015/10/how-i-prepared-my-keynote.html">how she prepared her keynote</a>\nfor <a href="http://blog.sqisland.com/2015/03/write-speak-code.html">Write/Speak/Code</a>.</p>\n<p>You can also follow her on Twitter at <a href="https://twitter.com/chiuki">@chiuki</a>.</p>',timeToRead:2,excerpt:"Accelerate your learning by sharing what you learn with others while you are\nlearning it. Experts aren't people who know absolutely…",frontmatter:{title:"What it means to be an expert",cover:"https://picsum.photos/1600/800/?image=26",date:"2016-06-22 21:10:43 +0200",category:null,tags:["Mindset","Comfort Zone","Personal Brand"]},fields:{slug:"/blog/what-it-means-to-be-an-expert"}},prev:{excerpt:"Be the change you want to see even if it doesn't change anything right away. An ego is a person's sense of self-esteem or self-importance. It can be\ndetrimental to a person and those around them if…",timeToRead:5,frontmatter:{title:"The ego barrier",cover:"https://picsum.photos/1600/800/?image=34",date:"2016-06-29 20:24:42 +0200"},fields:{slug:"/blog/the-ego-barrier"}},next:{excerpt:"If you are new to fiddles, it's an online code playground that let's you\nquickly experiment, visualize results and share code without having to start\nup an IDE, editor or server of some sort. They are…",timeToRead:6,frontmatter:{title:"Discovering fiddles",cover:"https://picsum.photos/1600/800/?image=527",date:"2016-06-19 19:13:00 +0200"},fields:{slug:"/blog/discovering-fiddles"}}},pathContext:{slug:"/blog/what-it-means-to-be-an-expert",total:57,prev:"/blog/the-ego-barrier",next:"/blog/discovering-fiddles"}}}});
